import { Link, useLocation } from "react-router-dom";
import { Menu } from "./Menu";

export const Nav = () => {
  if (useLocation().pathname === "/") {
    return null;
  }
  return (
    <header>
      <div className="logo_container">
        <Link to="/">
          <img src="logo.jpg" alt="я тут" />
        </Link>
      </div>
      <div className="menu">
        <Menu />
      </div>
    </header>
  );
};
